import { Route } from "react-router-dom";

import Welcome from './Pages/Welcome';
import Products from './Pages/Products'
import MainHeader from './Components/MainHeader';

function App() {
  return (
    <div>
      <BrowserRouter>
      <MainHeader />
      <main>
        <Route path='/welcome'>
          <Welcome />
        </Route>
        <Route path='/products'>
          <Products />
        </Route>
      </main>
    </BrowserRouter>
    </div>
  );
}

export default App;
